{
  "openapi": "3.0.0",
  "paths": {
    "/manage/entity/{dtmi}": {
      "get": {
        "operationId": "getEntity",
        "summary": "Get the stored model entity.",
        "parameters": [
          {
            "name": "dtmi",
            "required": true,
            "in": "path",
            "schema": { "type": "string" }
          }
        ],
        "responses": {
          "200": {
            "description": "Returns the requested model entity based on its dtmi.",
            "content": {
              "application/json": {
                "schema": { "$ref": "#/components/schemas/ModelEntity" }
              }
            }
          }
        },
        "tags": ["manage-models"],
        "security": [{ "oauth2": ["catalog-api"] }]
      }
    },
    "/manage/entities": {
      "get": {
        "operationId": "getAllEntities",
        "summary": "Get all stored model entities.",
        "parameters": [
          {
            "name": "size",
            "required": true,
            "in": "query",
            "schema": { "type": "number" }
          },
          {
            "name": "page",
            "required": true,
            "in": "query",
            "schema": { "type": "number" }
          }
        ],
        "responses": {
          "200": {
            "description": "Returns all stored model entities.",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/ModelEntityPagedResult"
                }
              }
            }
          }
        },
        "tags": ["manage-models"],
        "security": [{ "oauth2": ["catalog-api"] }]
      }
    },
    "/manage/model": {
      "post": {
        "operationId": "addNewModel",
        "summary": "Add a new model to the catalog api.",
        "parameters": [],
        "requestBody": {
          "required": true,
          "content": {
            "application/json": {
              "schema": { "$ref": "#/components/schemas/Interface" }
            }
          }
        },
        "responses": {
          "201": {
            "description": "The model has been successfully added.",
            "content": {
              "application/json": {
                "schema": { "$ref": "#/components/schemas/ModelEntity" }
              }
            }
          }
        },
        "tags": ["manage-models"],
        "security": [{ "oauth2": ["catalog-api"] }]
      }
    },
    "/manage/models": {
      "post": {
        "operationId": "addNewModels",
        "summary": "Add multiple new models to the catalog api.",
        "parameters": [],
        "requestBody": {
          "required": true,
          "content": {
            "application/json": {
              "schema": {
                "type": "array",
                "items": { "$ref": "#/components/schemas/Interface" }
              }
            }
          }
        },
        "responses": {
          "201": {
            "description": "The record has been successfully created.",
            "content": {
              "application/json": {
                "schema": {
                  "type": "array",
                  "items": { "$ref": "#/components/schemas/ModelEntity" }
                }
              }
            }
          }
        },
        "tags": ["manage-models"],
        "security": [{ "oauth2": ["catalog-api"] }]
      }
    },
    "/manage/model/{dtmi}/revoke": {
      "put": {
        "operationId": "revokeModel",
        "summary": "Revoke a model.",
        "parameters": [
          {
            "name": "dtmi",
            "required": true,
            "in": "path",
            "schema": { "type": "string" }
          }
        ],
        "responses": {
          "202": {
            "description": "The model has been successfully added.",
            "content": {
              "application/json": {
                "schema": { "$ref": "#/components/schemas/ModelEntity" }
              }
            }
          }
        },
        "tags": ["manage-models"],
        "security": [{ "oauth2": ["catalog-api"] }]
      }
    },
    "/graph/expanded": {
      "get": {
        "operationId": "getExpandedModels",
        "summary": "Get all stored models in expanded form.",
        "parameters": [
          {
            "name": "size",
            "required": true,
            "in": "query",
            "schema": { "type": "number" }
          },
          {
            "name": "page",
            "required": true,
            "in": "query",
            "schema": { "type": "number" }
          }
        ],
        "responses": {
          "200": {
            "description": "Returns all stored models in their expanded representation.",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/ExpandedInterfacePagedResult"
                }
              }
            }
          }
        },
        "tags": ["dtdl-models"],
        "security": [{ "oauth2": ["catalog-api"] }]
      }
    },
    "/graph/roots": {
      "get": {
        "operationId": "getRoots",
        "summary": "Get stored root models in expanded form.",
        "parameters": [],
        "responses": {
          "200": {
            "description": "Returns root models in their expanded representation.",
            "content": {
              "application/json": {
                "schema": {
                  "type": "array",
                  "items": { "$ref": "#/components/schemas/ExpandedInterface" }
                }
              }
            }
          }
        },
        "tags": ["dtdl-models"],
        "security": [{ "oauth2": ["catalog-api"] }]
      }
    },
    "/graph/{dtmi}/bases": {
      "get": {
        "operationId": "getBases",
        "summary": "Gets the bases of the requested model",
        "parameters": [
          {
            "name": "dtmi",
            "required": true,
            "in": "path",
            "schema": { "type": "string" }
          }
        ],
        "responses": {
          "200": {
            "description": "Returns the bases of a model",
            "content": {
              "application/json": {
                "schema": { "type": "array", "items": { "type": "string" } }
              }
            }
          }
        },
        "tags": ["dtdl-models"],
        "security": [{ "oauth2": ["catalog-api"] }]
      }
    },
    "/graph/{dtmi}/children": {
      "get": {
        "operationId": "getChildren",
        "summary": "Gets the children of the requested model up to a optionally specified depth",
        "parameters": [
          {
            "name": "dtmi",
            "required": true,
            "in": "path",
            "schema": { "type": "string" }
          },
          {
            "name": "depth",
            "required": false,
            "in": "query",
            "schema": { "type": "number" }
          }
        ],
        "responses": {
          "200": {
            "description": "Returns the children of a model",
            "content": {
              "application/json": {
                "schema": {
                  "type": "array",
                  "items": { "$ref": "#/components/schemas/ExpandedInterface" }
                }
              }
            }
          }
        },
        "tags": ["dtdl-models"],
        "security": [{ "oauth2": ["catalog-api"] }]
      }
    },
    "/graph/{dtmi}/expand": {
      "get": {
        "operationId": "getExpanded",
        "summary": "Get the requested model in expanded form.",
        "parameters": [
          {
            "name": "dtmi",
            "required": true,
            "in": "path",
            "schema": { "type": "string" }
          }
        ],
        "responses": {
          "200": {
            "description": "Returns a model in its expanded representation.",
