              "application/json": {
                "schema": { "$ref": "#/components/schemas/ExpandedInterface" }
              }
            }
          }
        },
        "tags": ["dtdl-models"],
        "security": [{ "oauth2": ["catalog-api"] }]
      }
    },
    "/graph/{dtmi}/simplified": {
      "get": {
        "operationId": "getSimplified",
        "summary": "Get the requested model in simplified form.",
        "parameters": [
          {
            "name": "dtmi",
            "required": true,
            "in": "path",
            "schema": { "type": "string" }
          }
