                "schema": { "$ref": "#/components/schemas/ExpandedInterface" }
              }
            }
          }
        },
        "tags": ["dtdl-models"],
        "security": [{ "oauth2": ["catalog-api"] }]
      }
    },
    "/graph/{dtmi}/full-expand": {
      "get": {
        "operationId": "getFullyExpanded",
        "summary": "Get the requested model with related models inlined (JSON-LD representation).",
        "parameters": [
          {
            "name": "dtmi",
            "required": true,
            "in": "path",
            "schema": { "type": "string" }
          },
          {
            "name": "includeContext",
            "required": false,
            "in": "query",
            "schema": { "type": "boolean" }
          }
        ],
        "responses": {
          "200": {
            "description": "Returns a model in its expanded representation.",
            "content": {
              "application/json": {
                "schema": { "$ref": "#/components/schemas/ExpandedInterface" }
              }
            }
          }
        },
        "tags": ["dtdl-models"],
        "security": [{ "oauth2": ["catalog-api"] }]
      }
    },
    "/graph/relationships/{sourceDtmi}/{targetDtmi}": {
      "get": {
        "operationId": "getRelationships",
        "summary": "Get the involved relationships between two models.",
        "parameters": [
          {
            "name": "sourceDtmi",
            "required": true,
            "in": "path",
            "schema": { "type": "string" }
          },
          {
            "name": "targetDtmi",
            "required": true,
            "in": "path",
            "schema": { "type": "string" }
          }
        ],
        "responses": {
          "200": {
            "description": "Returns the possible relationships between two models.",
            "content": {
              "application/json": {
                "schema": {
                  "type": "array",
                  "items": { "$ref": "#/components/schemas/Relationship" }
                }
              }
            }
          }
        },
        "tags": ["dtdl-models"],
        "security": [{ "oauth2": ["catalog-api"] }]
      }
    },
    "/graph/relationships/{sourceDtmi}": {
      "get": {
        "operationId": "getOutgoingRelationships",
        "summary": "Get the outgoing relationships of a model.",
        "parameters": [
          {
            "name": "sourceDtmi",
            "required": true,
            "in": "path",
            "schema": { "type": "string" }
