        "security": [{ "oauth2": ["catalog-api"] }]
      }
    },
    "/validate/schema/{dtmi}": {
      "get": {
        "operationId": "ValidationController_getSchema",
        "parameters": [
          {
            "name": "dtmi",
            "required": true,
            "in": "path",
            "schema": { "type": "string" }
          }
        ],
        "responses": {
          "200": {
            "description": "Returns a JSON schema for the requested model",
            "content": {
              "application/json": {
                "schema": { "$ref": "#/components/schemas/Schema" }
              }
            }
          }
        },
        "tags": ["validation"],
        "security": [{ "oauth2": ["catalog-api"] }]
      }
    },
    "/validate": {
      "post": {
        "operationId": "ValidationController_validateInstance",
        "summary": "Validate twin instance",
        "parameters": [],
        "requestBody": {
          "required": true,
          "content": {
            "application/json": {
              "schema": { "$ref": "#/components/schemas/TwinInstance" }
            }
          }
        },
        "responses": {
          "200": {
            "description": "Returns validation result for instance.",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/SchemaValidationError"
                }
              }
            }
          }
        },
        "tags": ["validation"],
        "security": [{ "oauth2": ["catalog-api"] }]
      }
    },
    "/validate/graph": {
      "post": {
        "operationId": "ValidationController_validateGraph",
